import React from "react";


const List = ({list}) => {
    return (
        <>
            {
                list.map((item) => {
                    const {title, description, priority} = item
                    return (
                        <>
                                 <div>{title}</div>
                            <div>{description}</div>
                        <div>{priority}</div>
                        </>

                    )
                })
            }
        </>
    );
}

export default List;
